import React from "react";
import { useState, useEffect } from "react";
import { UnitCard } from "../components/UnitCard/UnitCard";
import { CreateTopicModal } from "../modals/CreateTopicModal/CreateTopicModal";

const Dashboard = () => {
  const [units, setUnits] = useState([]);

  useEffect(() => {
    setData(require("../data/data.json"));
  }, []);

  let getUnits = async () => {
    let response = await fetch('http://127.0.0.1:8000/api/units/')
    let data = response.json();
    console.log('DATA', data)
    setUnits();
  }

  return (
    <div>
      {data["units"].map((unit, key) => {
        return (
          <div key={key} class="col">
            <UnitCard
              unit_name={unit.unit_name}
              unit_id={key + 1}
              topics={unit.topics}
            ></UnitCard>
          </div>
        );
      })}
      <CreateTopicModal></CreateTopicModal>
    </div>
  );
};

export default Dashboard;
